def PLOT(event):
    #Get Variables
   # Index
    n=Labels.index(cb.get())
    m=cy.current();
    # Score
    Score=float('%.2g' % A_Opt[n,m])
    var = tk.StringVar()
    var.set(str(Rank[n,m]))
    R2 = tk.Label(window, textvariable=var,fg='Black', font=("Helvetica", 16))
    R2.place(x=200,y=500)
