    str1 = Labels[n]
    str2 = str(m+1990)
    if str2 == str(1989):
        str2=str(2015)
    newstr = " ".join((str1, str2))
    if np.invert(np.isnan(Score)):
        Y=[GDP_N[n,m],CO2_N[n,m],Exp_N[n,m],Ren_N[n,m],Water_N[n,m],Land_N[n,m],Mat_N[n,m],HDI_N[n,m],GDP_N[n,m]]
        x,y=pol2cart(Y,X)
        ax1 = figure1.add_subplot(111)
        ax1.plot(x,y,label=newstr)
        ax1.legend(bbox_to_anchor=(-0.16,-0.15), loc='lower left', ncol=2,frameon=False)
        figure1.canvas.draw_idle()
        fig = go.Figure(go.Indicator(
            mode = "gauge+number",
            value = Score,
            domain = {'x': [0, 1], 'y': [0, 1]},
            gauge = {
                'axis': {'range': [0, 1], 'tickwidth': 1, 'tickcolor': "black"},
                'bar': {'color': "black"},
                'bgcolor': "white",
                'borderwidth': 0,
                'bordercolor': "gray",
                'steps': [
                    {'range': [0,0.2], 'color': 'red'},
                    {'range': [0.2, 0.5], 'color': 'yellow'},
                    {'range': [0.5, 1], 'color': 'green'}],
            
                },))
        if Score<0.2:  
            fig.add_annotation(x=0.15, y=0.1,
                        text="Critical",
                        showarrow=False,
                        arrowhead=1,
                        font_color='red')
        if 0.2<Score<0.5:
            fig.add_annotation(x=0.25, y=0.5,
                        text="Alert",
                        showarrow=False,
                        arrowhead=1,
                        font_color='yellow')
        if Score>=0.5:
            fig.add_annotation(x=0.8, y=0.35,
                        text="Good",
                        showarrow=False,
                        arrowhead=1,
                        font_color='green')
        fig.update_annotations(font_size=32)
        fig.update_layout(font = {'color': "black", 'family': "Helvetica",'size':20})
        fig.write_image('Gauge.png')
        frame=tk.Frame(window,width = 300, height = 200,background='black')
        frame.place(x=30,y=300)
        canvas = tk.Canvas(frame, width = 300, height = 200)
        img = Image.open('Gauge.png')  # PIL solution
        img = img.resize((300, 200), Image.ANTIALIAS)
        img = ImageTk.PhotoImage(img)
        canvas.create_image(150,100,image=img)
       
        canvas.pack(expand=tk.TRUE, fill=tk.BOTH)
        canvas.draw_idle()
        
        
    else:
        newWindow = tk.Toplevel(window) 
        newWindow.title("No data available") 
        newWindow.geometry("250x50") 
        tk.Label(newWindow,  
              text =textwrap.dedent("""\
                                    No data available!""")).pack()
        newWindow.lift()
        newWindow.attributes('-topmost',True)
      
       
